import React from 'react';

export default function Hero() {
  return (
    <header className="bg-black text-white relative overflow-hidden">
      {/* Logo and Navigation */}
      <div className="flex justify-between items-center p-6">
        <div className="text-2xl font-bold text-white">PR</div>
        <div className="text-white cursor-pointer">
          <div className="w-6 h-0.5 bg-white mb-1"></div>
          <div className="w-6 h-0.5 bg-white mb-1"></div>
          <div className="w-6 h-0.5 bg-white"></div>
        </div>
      </div>

      {/* Hero Content */}
      <div className="flex flex-col items-center justify-center py-20 relative">
        {/* Selection Box */}
        <div className="relative p-8 rounded-lg mb-8">
          <h1 className="text-6xl font-bold text-center">Aidar Uraev</h1>
          <h2 className="text-2xl text-center mt-2">WEB-DESIGNER</h2>
        </div>

      </div>
    </header>
  );
}
